import React from 'react'
import s from './Content.module.css'
import { useFormik } from 'formik';

function Content() {

    const formik = useFormik({
        initialValues: {
            FirsName: '',
            Name: '',
            FatherName: '',
            Email: '',
            University: '',
            Stage: '',
            Telephone: '',
            isJava: false
        },
        onSubmit: (values) => {
            console.log(values)
        },
    });

    return (
        <div>
            <form className={s.LoginForm}>
            </form>
        </div>
    );
}


export default Content;
